  #consentCard,
  .cart-item {
    margin-bottom: 24px;
    margin-top: 0;
    width: 328px;
  }

  .cart-item {
    cursor: pointer;
    display: flex;
    flex-direction: row;
    height: var(--row-height);
    padding-inline: 15px 15px;
    position: relative;
    text-decoration: none;
  }

  #consentCard {
    align-items: center;
    border: 1px solid var(--ntp-border-color);
    border-radius: 8px;
    box-sizing: border-box;
    display: flex;
    flex-direction: column;
    height: 106px;
    margin-inline: 15px;
  }

  #consentContent {
    color: var(--cr-primary-text-color);
    font-size: 13px;
    font-weight: 400;
    height: 40px;
    line-height: 20px;
    margin-top: 12px;
    text-align: center;
    white-space: normal;
    width: 223px;
  }

  #consentButtonContainer {
    display: flex;
    justify-content: center;
    margin-top: 8px;
  }

  .discount-chip {
    background: var(--discount-chip-background);
    border-radius: 30px;
    color: var(--discount-chip-text-color);
    display: flex;
    font-size: 12px;
    justify-content: center;
    line-height: 20px;
    margin-top: 2px;
    padding-bottom: 2px;
    padding-inline-end: 8px;
    padding-inline-start: 8px;
    padding-top: 2px;
    width: max-content;
  }

  :host-context(.focus-outline-visible) .cart-item:focus {
    box-shadow: var(--ntp-focus-shadow);
  }

  .cart-title {
    color: var(--cr-primary-text-color);
    display: flex;
    flex-direction: column;
    flex-shrink: 0;
    font-size: 13px;
    width: 99px;
  }

  .merchant-container {
    overflow: hidden;
    text-overflow: ellipsis;
    white-space: nowrap;
    width: 91px;
  }

  .cart-title .merchant {
    display: inline-block;
    font-size: 18px;
    font-weight: 400;
    height: 24px;
    max-width: 75px;
    overflow: hidden;
    text-overflow: ellipsis;
    text-shadow: var(--ntp-theme-text-shadow);
    white-space: nowrap;
  }

  .cart-title .item-count {
    color: var(--cr-secondary-text-color);
  }

  .item-count {
    font-size: 10px;
    line-height: 16px;
  }

  .thumbnail-container {
    align-items: center;
    display: flex;
    height: var(--row-height);
    margin-inline-start: 16px;
    overflow-x: hidden;
    text-align: center;
  }

  .thumbnail-container ul {
    display: flex;
    height: var(--row-height);
    list-style-type: none;
    margin-block-end: 0;
    margin-block-start: 0;
    overflow: hidden;
    padding: 0;
